script: |
  super -f text -I q7624.spq | sort > q7624.out

inputs:
  - name: q7624.spq
    data: |
      SELECT DISTINCT + col2 + + - col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col0 + + col1 + + col2 * + + col0 * + + col0 + + col1 * - col1 BETWEEN + 27 AND col2;
  - name: tab0

outputs:
  - name: q7624.out
    data: |
      -11
      -34
      98
